$j.fn.checkNColor = function(trId){
if($j('#' + trId + ' input[type="radio"]:checked').val() == "true") {
$j('#' + trId + ' input[type="checkbox"]').prop("checked",true);

$j('#' + trId + ' .green').css("background-color","green");
$j('#' + trId + ' .yellow').css("background-color","yellow");
$j('#' + trId + ' .red').css("background-color","red");
} else {
$('#' + trId + ' input[type="checkbox"]').prop("checked",false);

$j('#' + trId + ' .green').css("background-color","white");
$j('#' + trId + ' .yellow').css("background-color","white");
$j('#' + trId + ' .red').css("background-color","white");
}
}

